import { useState, useEffect } from "react";
import "../style/home.css";

import NavigationBar from "../component/navigationBar";
import Display from "../component/display";

function Home() {
	const page: string = "";

	function menuClickHandler(params: boolean) {
		let element = document.getElementById("home_body_container")!;
		params
			? element.classList.remove("active")
			: element.classList.add("active");
	}

	return (
		<div className='home_container'>
			<NavigationBar func={menuClickHandler} data='Home' />
			<div className='side_menu'></div>
			<div id='home_body_container' className='home_body_container'>
				<Display />
			</div>
		</div>
	);
}

export default Home;
